    useEffect(() =>{
        getRunnerInfo()
        .then((runner) => setRunnerInfo(runner))
        console.log(runnerInfo)
        },[]);

if (runnerInfo.length > 0) {
    return(
        <div>
        <div className='race'>
            <h2>Your race...</h2>
